import React, { useEffect, useState } from "react";

function Lefthalf(){

    return(
        <div className="Lefthalf">
            <div className="header">Мы работаем быстро и наши отчеты проходят согласование с первого раза</div>
            <div className="underheader">Над вашим объектом работает целая команда: 3 ГИПа (главных инженеров проектов) с опытом работы от 6 лет и 2 штатных сотрудника для камеральных работ</div>
        </div>
    );
}

export default Lefthalf;
